import React from 'react';

const ApiResponseDisplay = ({ apiResponse }) => {
  return (
    <div className="api-response">
      <h3>API Response:</h3>
      <pre>{JSON.stringify(apiResponse, null, 2)}</pre>
    </div>
  );
};

export default ApiResponseDisplay;
